import "./App.css";
import React from "react";
import {
  Route,
  BrowserRouter as Router,
  Switch,
  Routes,
} from "react-router-dom";
// import Service from "./Components/Services/Service";
import AboutUs from "./Components/AboutUs/AboutUs";
import Home from "./Components/Home/Home";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/">
            <Home />
          </Route>
          <Route path="/about">
            <AboutUs />
          </Route>
        </Switch>
      </Router>
      {/* <Service /> */}
    </div>
  );
}

export default App;
